import React, { useState, useEffect } from "react";
import Navbar from "./component/Navbar";
import Propagateloader from "react-spinners/PropagateLoader";
import { black } from "color-name";
import "./App.css";
import { css } from "@emotion/react";

function App() {
  const [loading, setLoading] = useState(false);
  const override = css`
    display: black;
    border-color: red;
    margin-top: 20%;
  `;
  useEffect(() => {
    setLoading(true);
    setTimeout(() => {
      setLoading(false);
    }, 5000);
  }, []);

  return (
    <div className="App">
      {loading ? (
        <Propagateloader
          color={"#3d2514"}
          loading={loading}
          css={override}
          size={40}
        />
      ) : (
        <>
          <Navbar />
        </>
      )}
    </div>
  );
}

export default App;
